import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css";

function Card() {
  return (
    <>
      <header>
        <div className="header">
          <p> top amazon series</p>
        </div>
      </header>
      <section>
        <div className="cards">
          <div className="card">
            <img src="https://wallpapercave.com/wp/wp7787787.jpg"
              alt="Mirjapur"
              className="img" />
            <p>amazon original series</p>
            <h2>MIRZAPUR</h2>
            <button><a href="https://www.netflix.com/in/title/80100172" target="_blank">Watch now</a></button>
          </div>
        </div>

      </section>

    </>

  );
}

ReactDOM.render(<Card />
  , document.getElementById('root')
);
